        $('#txt-search').keyup(function() {
            var searchField = $(this).val();
            if (searchField === '') {
                $('#filter-records').html('');
                return;
            }

            var regex = new RegExp(searchField, "i");
            var output = '<div class="row">';
            var count = 1;
            $.each(data, function(key, val) {
              if ((val.code_clasf.search(regex) != -1) || (val.code_clasf.search(regex) != -1)) {
                output += '<div class="col-md-6" well>';
                output += '<div class="col-md-3"><img class="img" src="'+ val.imagen +'" alt="icono"'+' /></div>';
                output += '<div class="col-md-7"> ';
                output += '<h5 class="lista">'+"Clasificador: " + val.code_clasf + '</h5>';
                output += '<h5 class="lista">'+"Apto para mod: " + " " + val.nota +'</h5>';
                output += '<h5 class="lista">'+"Habilitadora: " + val.habilitadora + '</h5>';
                output += '<h5 class="lista">'+"Habilitada: " + val.habilitada + '</h5>';
                output += '</div>';
                output += '</div>';
                  if (count % 2 == 0) {
                      output += '</div><div class="row">'
                  }
                    count++;
                }
            });
            output += '</div>';
            $('#filter-records').html(output);
        });
    });
